    <div className="continueButton">
      <button type="button" className="btn btn-outline-danger"> Back &lt;</button>
      <button type="button" className="btn btn-outline-danger"> Next ></button>
      <button type="button" style="visibility: visible; display: block;" className="btn btn-default resume" alt="Continue to next frame">
        Continue </button>
    </div>
  );
}

